import logo from './logo.svg';
import './App.css';
import TodoList from './components/TodoList'
import 'bootstrap/dist/css/bootstrap.min.css'
import 'font-awesome/css/font-awesome.min.css'


function App()
{
  return (
    <div className="App">
      <script src="https://kit.fontawesome.com/334171a8c4.js" crossorigin="anonymous"></script>
      <TodoList />
    </div>
  );
}

export default App;
